    private LootTable getLootBasedOnSettlerID(GameRandom random, String settlerID) {
        if (settlerID.equals("alchemisthuman")) {
            return LootTablePresets.alchemistChest;
        }
        return random.getOneOf(new LootTable(new LootItem("magehat"), new LootItem("magerobe"), new LootItem("mageshoes")), new LootTable(new LootItem("crimsonhat"), new LootItem("crimsonrobe"), new LootItem("crimsonshoes")));
    }
